// React imports
import React from 'react';
import ReactDOM from 'react-dom';

// Global imports
import 'styles/global.css';

// Navigation
import HandleNavigation from 'routes';
import Dropdown from 'components/Dropdown';
// React application
function App() {
  return (
    <div className="App">
      <HandleNavigation />
      <div style={{ marginLeft: '64px' }}>
        <Dropdown
          placeholder="Dropdown"
          options={[
            {
              label: 'Novice',
              value: 'novice',
            },
            {
              label: 'Intermediate',
              value: 'intermediate',
            },
            {
              label: 'Advanced',
              value: 'advanced',
            },
          ]}
        />
      </div>
    </div>
  );
}

// Render React application
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
